import React, {Component} from 'react';

class ErrorBoundry extends Component {
	constructor(props) {
		super(props)
		this.state = {
			hasError: false
		}
	}

	render() {
		if(this.state.hasError) {
			return <h1>Ooopps. That`s not good</h1>
		}
	}
};



export default ErrorBoundry;
